  return (
      <React.Fragment>
          <div className="container">
            <div className="row">
                <div className="col-10 mt-2 ml-sm-5 ml-md-auto col-sm-8 text-capitalize text-right">

                </div>
            </div>
          </div>
      </React.Fragment>
  )
}

export default CartTotals
